import React from "react";

import { Swiper, SwiperSlide } from "swiper/react";

import "swiper/css";
import Testimonial from "./Testimonial";

export default function TestimonialCarousel() {
  return (
    <>
      <Swiper
        slidesPerView={2}
        spaceBetween={100}
        modules={[]}
        className="mySwiper"
      >
        <SwiperSlide>
          <Testimonial text="ttesfsfdasdfsfdsfdsfdsfds" author="PLurarc" />

          <Testimonial text="ttesfsfdasdfsfdsfdsfdsfds" author="PLurarc" />
        </SwiperSlide>
      </Swiper>
    </>
  );
}
